import React from 'react';
import axios from 'axios';

export default class MovieList extends React.Component {
  state = {
    Search: [],
    totalResult:0,
    Response:false
  }

  componentDidMount() {
    axios.get(`http://www.omdbapi.com/?apikey=faf7e5bb&s=Batman&page=2`)
      .then(res => {
        const Search = res.data.Search;
        const totalResult = res.data.totalResult;
        const Response = res.data.Response;
        this.setState({ Search });
        this.setState({ totalResult });
        this.setState({ Response });
      })
  }


  render() {
    return (
            <div>
                <h3>LIST MOVIE</h3>
                <h3>TOTAL RESULT : {this.state.totalResult} </h3>
                <h3>RESPONSE: {this.state.Response} </h3>

            </div>

    )
  }
}
